import { useState } from "react";

const User = ({name, location}) => {
    const [count] = useState();
    return(
        <div>
            <h1>"count = " {count}</h1>
            <h1>{name}</h1>
            <h1>{location}</h1>
        </div>
    )
}

export default User;
